INSERT INTO `news` VALUES (10117350560004, '1', 1, '1', 8, '2024-12-21 19:53:09', '2024-12-23 00:35:42', 0);
INSERT INTO `news` VALUES (10117350560005, '北京连续三天最高温超40℃，6月“炎值”因何爆表？', 1, '　中新社北京6月24日电 (记者 陈杭 徐婧)京城连续三日“热晴不减”，且高温红色预警持续生效。截至24日13时51分，作为北京地区气象观测代表站的南郊观象台气温突破40℃，这是该站观测史上首次连续三天气温超40℃。22日以来，北京高温“烤验”突出。22日，北京南郊观象台最高气温达41.1℃，这是有观测纪录以来历史第二高(并列)。北京市气象局表示，观象台1951年建站以来极端最高气温为41.9℃，出现在1999年7月24日。\n\n　　23日，北京南郊观象台最高气温为40.3℃，这是该观象台建站以来首次出现连续两天最高气温超40℃。当天，北京时隔9年再次发布最高级别的高温红色预警信号。', 11, '2024-12-23 17:01:08', '2024-12-23 17:01:12', 0);
